import './App.css';
// import App from './app/App';
import Login from '../pageComponents/Login';
import Start from '../pageComponents/Start';
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';

function App() {
  return (
    <Router>
    <div className="App">
      <header className="App-header">
        <Switch>
            <Route path='/login'>
                <Login />
            </Route>
            <Route path='/start'>
                <Start />
            </Route>
        </Switch>
      </header>
    </div>
    </Router>
  );
}

export default App;
